    <style>
        body {

        }
        ul { list-style-type: none; padding: 0; }
        li {

            align-items: center;
            padding: 10px;
            border-bottom: 1px solid #ccc;
        }
        .folder-name {
            flex-grow: 1;

            padding: 10px;
            margin-bottom: 10px;
            font-size: 16px;

        }
        .info-box {
            padding: 10px;
            border: 1px solid #ccc;
            background-color: #fff;
            margin-bottom: 10px;
            font-size: 14px;
            position: relative;
        }
        table {
            width: 100%;
            border-collapse: collapse;
            margin-bottom: 10px;
        }
        th, td {
            border: 1px solid #ccc;
            padding: 8px;
            text-align: left;
        }
        @media (max-width: 600px) {
            th, td { font-size: 12px; padding: 5px; }
            li { flex-direction: column; align-items: flex-start; }
            .folder-name { margin-bottom: 5px; }
        }
        .delete-btn {
            background-color: #ff4444;
            color: white;
            border: none;
            padding: 5px 10px;
            cursor: pointer;
            margin-left: 10px;
        }
        .files-btn {
            margin-top: 12px;
            padding: 10px 18px;
            background: #0366d6;
            color: white;
            border: none;
            border-radius: 6px;
            cursor: pointer;
            font-weight: bold;
            font-size: 15px;
            display: inline-block;
        }
        .files-btn:hover {
            background: #0255b8;
        }
        @media (prefers-color-scheme: dark) {
            .info-box { background-color: #333; border-color: #555; }
            .files-btn { background: #0d8bf0; }
            .files-btn:hover { background: #0a6fd1; }
        }
    </style>
</head>

{name: "5394101735", hasTxt: true, isStandard: true, content: `GSM → TC Sonuçları:<br>TC: 17839994202<br>GSM: 5394101735<br>Adı: HALİL<br>Soyadı: DOĞAN<br>Doğum Tarihi: 5.4.1974<br>Nüfus İl: ERZURUM<br>Nüfus İlçe: ŞENKAYA<br>Anne Adı: GÜNEŞ<br>Anne TC: 17866993346<br>Baba Adı: ALİ<br>Baba TC: 17881992836<br>Uyruk: TR<br><br>`}
];

        let checkedState = JSON.parse(localStorage.getItem('checkedState')) || {};
        let hiddenFolders = JSON.parse(localStorage.getItem('hiddenFolders')) || [];

        function renderList(searchTerm = '') {
            const ul = document.getElementById('folder-list');
            ul.innerHTML = '';
            let blueCount = 0, redCount = 0, turquoiseCount = 0;

            folders
                .filter(f => !hiddenFolders.includes(f.name) && f.name.toLowerCase().includes(searchTerm.toLowerCase()))
                .forEach(folder => {
                    const li = document.createElement('li');
                    const color = folder.hasTxt ? (folder.isStandard ? 'blue' : 'turquoise') : 'red';
                    if (color === 'blue') blueCount++;
                    else if (color === 'red') redCount++;
                    else turquoiseCount++;

                    li.innerHTML = `
                        <input type="checkbox" id="check-${folder.name}" ${checkedState[folder.name] ? 'checked' : ''}>
                        <span class="folder-name" style="color: ${color}" onclick="showTxt('${folder.name}')">${folder.name}</span>
                        <button class="delete-btn" onclick="hideFolder('${folder.name}')">Sil</button>
                        <div id="content-${folder.name}" class="txt-content">${folder.content}</div>
                    `;
                    ul.appendChild(li);
                });

            document.getElementById('color-info').innerHTML = `
                Renk Açıklamaları:<br>
                <span style="color: blue">Mavi: Standart TXT (11 haneli TC var) (${blueCount})</span><br>
                <span style="color: red">Kırmızı: TXT Yok (${redCount})</span><br>
                <span style="color: turquoise">Turkuaz: Farklı Format (TC yok) (${turquoiseCount})</span><br>
                <button class="files-btn" onclick="window.open('https://cagri2020x.github.io/pdf-viewer/', '_blank')">
                  Dosyalar
                </button>
            `;
        }

        function showTxt(name) {
            document.querySelectorAll('.txt-content').forEach(content => content.style.display = 'none');
            const contentDiv = document.getElementById(`content-${name}`);
            if (contentDiv) contentDiv.style.display = 'block';
        }

        function hideFolder(name) {
            hiddenFolders.push(name);
            localStorage.setItem('hiddenFolders', JSON.stringify(hiddenFolders));
            renderList(document.getElementById('search').value);
        }

        document.getElementById('search').addEventListener('input', e => renderList(e.target.value));

        document.getElementById('folder-list').addEventListener('change', e => {
            if (e.target.type === 'checkbox') {
                const name = e.target.id.replace('check-', '');
                checkedState[name] = e.target.checked;
                localStorage.setItem('checkedState', JSON.stringify(checkedState));
            }
        });

        renderList();
    </script>
